<script>
import { face } from '../../static/js/face'
export default {
    name: 'chat',
    data () {
        return {
        userName:'',
        messageList: [],
        friendList:[],
        myHead:'',
        nickname:'',
        newNick:'',
        sign:'',
        region:'',
        // 搜索相关
        userList:[],
        linkmanList:[],
        searchName:'',
        not_add:0,
        userInfo:{},
        default_note:'',

        icons:[
            'chat_icon.png',
            'user_icon.png',
            'box_icon.png'
        ],
        icons_:[
            'chat_icon_.png',
            'user_icon_.png',
            'box_icon_.png'
        ],
        write_flag: 0,
        // 获取更多信息相关
        more_chat: 1,
        chat_num: 1,
        no_chat: 0,

        head_index: 0,
        // 头像、昵称设置框
        alterbox_show: 0,
        // 其他设置框
        setbox_show: 0,
        // 设置框
        configbox_show: 0,
        icon_show: 0,
        message_show: -1,
        chat_title:'',
        friend_show: -1,
        friend_info:'',
        send_text:'',
        sendEmptyFlag: 0,
        // friendNickname_show:''
        // 用于装载聊天信息
        chat_list:[],
        obj:'',
        // 存储好友请求
        request_list:[],
        // 词云形状
        imageShape:'../../static/img/twitter.png',
        imgList: ['../../static/img/wordcloud0.jpg','../../static/img/twitter.png','../../static/img/wordcloud1.png','../../static/img/wordcloud2.png','../../static/img/wordcloud4.jpg','../../static/img/wordcloud5.png','../../static/img/wordcloud7.png','../../static/img/wordcloud8.png',],
        img_show: -1,
        maxFontSize: 60,
        minFontSize: 12,
        fontSizeFactor: 0.1,
        wordColor: 'blue',
        //词云内容
        wordList: [],
        // 过滤信息
        filterwords: '',
        // 当前备注
        tempNickname: '',
        // 显示修改input
        button_show: 0,
        }
    },
    created:function(){
        
    },
    mounted: function(){

        this.userName = window.sessionStorage.user;   // 从session中获取userName
        console.log('欢迎, ' + this.userName);

        var self = this;

        // 表情启动
        self.obj=new Face({
            el:document.querySelector('.face_icon'),
            callBack:function (face) {
                self.send_text+="〖"+face.title+"〗";
                document.querySelector('.face-warp').style.display='none';
            }
        });  

        // 获取用户信息
        axios.post(
            'https://afwt8c.toutiao15.com/get_user',
            {
                userName: this.userName
            }
        ).then((res)=>{
            // 处理正常结果
            const data = res.data;
            self.nickname = data.result.nickname;
            self.sign = data.result.sign;
            self.region = data.result.region;
        }).catch(function(error) {
            // 处理异常结果
            console.log(JSON.stringify(error));
            console.log(error.result);
        }).finally(function() {
            console.log('请求用户信息成功');
        });

        // 获取用户头像
        axios.post(
            'https://afwt8c.toutiao15.com/get_headImg',
            {
                userName: this.userName
            }
        ).then((res)=>{
            // 处理正常结果
            const data = res.data;
            self.myHead = data.result;
        }).catch(function(error) {
            // 处理异常结果
            console.log(JSON.stringify(error));
            console.log(error.result);
        }).finally(function() {
            console.log('请求头像成功');
        });

        // 请求最近消息列表
        axios.post(
            'https://afwt8c.toutiao15.com/get_message_list',
            {
                userName: this.userName
            }
        ).then((res)=>{
            // 处理正常结果
            const data = res.data;
            self.messageList = data.result;
            for(var i=0; i<self.messageList.length; i++){
                self.messageList[i].message = self.obj.replaceFace(self.messageList[i].message);
            }
            this.doFilter();
        }).catch(function(error) {
            // 处理异常结果           
            console.log(JSON.stringify(error));           
            console.log(error.result);           
        }).finally(function() {
          console.log('请求最近消息列表成功');
        });

        // 请求好友列表
        axios.post(
            'https://afwt8c.toutiao15.com/get_friend_list',
            {
                userName: this.userName
            }
        ).then((res)=>{
            // 处理正常结果
            const data = res.data;
            self.friendList = data.result;
        }).catch(function(error) {
            // 处理异常结果
            console.log(JSON.stringify(error));
            console.log(error.result);
        }).finally(function() {
          console.log('请求好友列表成功');
        });

        // 请求历史记录并分词
        // 获取用户头像
        axios.post(
            'https://afwt8c.toutiao15.com/get_words',
            {
                userName: this.userName
            }
        ).then((res)=>{
            // 处理正常结果
            const data = res.data;
