        // 显示词云
        renderCloud() {
            var words = this.wordList;
            var option = {
                fontSizeFactor: this.fontSizeFactor,                       // 当词云值相差太大，可设置此值进字体行大小微调，默认0.1
                maxFontSize: this.maxFontSize,                             // 最大fontSize，用来控制weightFactor，默认60
                minFontSize: this.minFontSize,                             // 最小fontSize，用来控制weightFactor，默认12
                tooltip: {
                    show: true,
                    formatter: function(item) {
                        return item
                    }
                },
                list: words,
                color: this.wordColor,
                imageShape: this.imageShape,
                ellipticity: 1
            }
            var wc = new Js2WordCloud(document.getElementById('wordcloudtest'))
            wc.showLoading({
                backgroundColor: '#fff',
                text: '正在加载...',
                effect: 'spin'
            })
            setTimeout(function() {
                wc.hideLoading()
                wc.setOption(option)
            }, 1000)
            /*
            window.onresize = function () {
                wc.setOption(option)
            }*/
            console.log('加载词云成功');
        },
